import styled from 'styled-components';

export const App = styled.div`
    height: auto 100%;
    margin-top: 0px;
    display: auto;
    justify-content: center;
    align-items: center;
`;

export const Container = styled.div`
    height: auto 100%;
    margin-top: 4%;
    display: flex;
    justify-content: center;
    align-items: center;
`;

export const Content = styled.div`
    width: 85%;
    height: auto 100%;
    margin: auto;
    display: center;
    float: center;
    background: #FFF;
    border-radius: 10px;
    box-shadow: 20px 20px 0px rgba(0, 0, 0, 0.1);
    padding: 30px;
    resize: auto;
`;

export const Table = styled.table`
    margin-top: 4%;
    text-align: justify;
    width: auto;
    height: auto;
    resize: auto;
    float: auto;
`;
